import React from 'react';

const Settings = () => {
    return (
        <div style={styles.container}>
            <h1 style={styles.header}>Settings</h1>
            <div style={styles.section}>
                <label style={styles.label}>Username:</label>
                <input type="text" style={styles.input} placeholder="Enter your username" />
            </div>
            <div style={styles.section}>
                <label style={styles.label}>Email:</label>
                <input type="email" style={styles.input} placeholder="Enter your email" />
            </div>
            <div style={styles.section}>
                <label style={styles.label}>Password:</label>
                <input type="password" style={styles.input} placeholder="Enter your password" />
            </div>
            <button style={styles.button}>Save Changes</button>
        </div>
    );
};

const styles = {
    container: {
        padding: '20px',
        maxWidth: '600px',
        margin: '0 auto',
        fontFamily: 'Arial, sans-serif',
    },
    header: {
        textAlign: 'center',
        marginBottom: '20px',
    },
    section: {
        marginBottom: '15px',
    },
    label: {
        display: 'block',
        marginBottom: '5px',
        fontWeight: 'bold',
    },
    input: {
        width: '100%',
        padding: '10px',
        borderRadius: '5px',
        border: '1px solid #ccc',
    },
    button: {
        display: 'block',
        width: '100%',
        padding: '10px',
        backgroundColor: '#007BFF',
        color: '#fff',
        border: 'none',
        borderRadius: '5px',
        cursor: 'pointer',
    },
};

export default Settings;
